// src/modules/beerGlass.ts
function pickingGlassSystem() {
  for (const [entity, pickedUp] of engine.getEntitiesWith(PickedUp)) {
    const tryToDropCommand = inputSystem.getInputCommand(InputAction.IA_PRIMARY, PointerEventType.PET_DOWN);
    const pickedUpChild = Array.from(getChildren(entity))[0];
    if (pickedUp.avatarId !== currentPlayerId || !pickedUpChild)
      continue;
    if (tryToDropCommand) {
      const hitPosition = tryToDropCommand.hit?.position || getPlayerPosition2();
      const hitEntity = tryToDropCommand.hit?.entityId;
      const hitParentEntity = getParent(hitEntity);
      let drop = false;
      if (hitParentEntity && TapBase.getOrNull(hitParentEntity)) {
        Transform2.createOrReplace(pickedUpChild, {
          //parent: hitParentEntity
        });
        parentEntity(pickedUpChild, hitParentEntity);
        console.log("parented to a tap, ", hitParentEntity, TapBase.getOrNull(hitParentEntity)?.beerType);
        drop = true;
      } else {
        const diff = Vector3.subtract(Vector3.Up(), tryToDropCommand.hit?.normalHit || Vector3.Zero());
        if (Vector3.length(diff) < 0.01) {
          removeParent(pickedUpChild);
          Transform2.createOrReplace(pickedUpChild, {
            position: hitPosition
            //parent: engine.RootEntity
          });
          drop = true;
        }
      }
      if (drop) {
        PickedUp.deleteFrom(entity);
        playSound2("sounds/putDown.mp3", false, pickedUpChild);
      }
    }
    const glass = BeerGlass.get(pickedUpChild);
    const tryToDrinkCommand = inputSystem.getInputCommand(InputAction.IA_SECONDARY, PointerEventType.PET_DOWN);
    if (glass.filled && tryToDrinkCommand) {
      BeerGlass.getMutable(pickedUpChild).filled = false;
      Animator3.playSingleAnimation(pickedUpChild, "Blank");
      playSound2("sounds/swallow.mp3", false, pickedUpChild);
    }
    return;
  }
  for (const [entity, glass] of engine.getEntitiesWith(BeerGlass)) {
    if (!glass.beingFilled && inputSystem.isTriggered(InputAction.IA_PRIMARY, PointerEventType.PET_DOWN, entity)) {
      const parentBeer = engine.addEntity();
      PickedUp.create(parentBeer, { avatarId: currentPlayerId });
      AvatarAttach2.create(parentBeer, {
        avatarId: currentPlayerId,
        anchorPointId: AvatarAnchorPointType.AAPT_RIGHT_HAND
      });
      Transform2.createOrReplace(entity, {
        position: Vector3.create(0, 0.225, 0),
        rotation: Quaternion.fromEulerDegrees(180, -90, -60)
        //parent: parentBeer
      });
      syncEntity(parentBeer, [AvatarAttach2.componentId, Transform2.componentId, PickedUp.componentId]);
      parentEntity(entity, parentBeer);
      playSound2("sounds/pickUp.mp3", false, entity);
    }
  }
}

// src/modules/tap.ts
function getBeerBehindTap(beerType) {
  for (const [glassEntity] of engine.getEntitiesWith(BeerGlass)) {
    const glassParent = getParent(glassEntity);
    if (glassParent && TapBase.getOrNull(glassParent)?.beerType === beerType) {
      return glassEntity;
    }
  }
}
function tapPumpSystem(dt) {
  for (const [entity, tapReadonly] of engine.getEntitiesWith(TapComponent)) {
    if (tapReadonly.pouring) {
      if (Scalar.withinEpsilon(tapReadonly.pouringTime, 0)) {
        Animator3.playSingleAnimation(entity, `Pour`);
        playSound2("sounds/beerPump.mp3", false, entity);
        const glassEntity = getBeerBehindTap(tapReadonly.beerType);
        if (glassEntity)
          Animator3.playSingleAnimation(glassEntity, `Pour${getTapData(tapReadonly.beerType).name}`);
      }
      const tap = TapComponent.getMutable(entity);
      tap.pouringTime += dt;
      if (tap.pouringTime >= 2.5) {
        tap.pouring = false;
        tap.pouringTime = 0;
        const glassEntity = getBeerBehindTap(tap.beerType);
        if (glassEntity) {
          const glass = BeerGlass.getMutable(glassEntity);
          glass.beerType = tap.beerType;
          glass.beingFilled = false;
          glass.filled = true;
        }
      }
    } else if (inputSystem.isTriggered(InputAction.IA_PRIMARY, PointerEventType.PET_DOWN, entity)) {
      const glassEntity = getBeerBehindTap(tapReadonly.beerType);
      if (!glassEntity) {
        return;
      }
      const glass = BeerGlass.getMutable(glassEntity);
      if (glass.filled) {
        return;
      }
      const tap = TapComponent.getMutable(entity);
      tap.pouring = true;
      tap.pouringTime = 0;
      glass.beingFilled = true;
      glass.beerType = tap.beerType;
    }
  }
}

